import React from 'react';
import { useForm } from 'react-hook-form';

export default function ModerLogin() {
  const { register, handleSubmit, errors } = useForm();

  const onSubmitt = (data) => {
    // Formdan olingan malumotlarni qaytarish
    console.log(data);
  };

  return (
    <div className='moderlogin'>
      <form onSubmit={handleSubmit(onSubmitt)}>
        <p>Moderator paneli</p>
        <input type="text" placeholder='+998' name="phoneNumber" ref={register({ required: true })} />
        {errors.phoneNumber && <span>Telefon raqami kerakli</span>}
        <button type="submit">Sms kod yuborish</button>
      </form>
    </div>
  );
}
